sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.eventId.trim().length == 0) {
        throw "Error while updating Event, invalid inputs have been passed.";
    }
    var defaultTZ = gs.getSession().getTimeZoneName();
    var timeZone = inputs.timeZone == "NULL_OVERRIDE" ? defaultTZ : (inputs.timeZone.toString() || defaultTZ);

    var requestBody = {};

    var util = new GoogleHangoutsMeetUtil();

    var attendeesList = inputs.attendees || [];
    var attendeesArrayObj = [];
    attendeesList.forEach(function(item) {
        item = item.trim();
        if (item.length == 0) {
            return;
        }
        if (util.isValidEmailAddress(item)) {
            attendeesArrayObj.push({
                "email": item
            });
        } else {
            throw "Invalid email address has been passed as input: " + item;
        }
    }, this);
    if (inputs.summary) {
        requestBody.summary = inputs.summary.trim().toString();
    }
    if (inputs.description) {
        requestBody.description = inputs.description.trim().toString();
    }
    if (inputs.location) {
        requestBody.location = inputs.location.trim().toString();
    }
    if (inputs.start_time) {
        requestBody.start = {
            "dateTime": inputs.start_time.replace(" ", "T"),
            "timeZone": timeZone
        };
    }
    if (inputs.end_time) {
        requestBody.end = {
            "dateTime": inputs.end_time.replace(" ", "T"),
            "timeZone": timeZone
        };
    }
    if (attendeesArrayObj.length > 0) {
        requestBody.attendees = attendeesArrayObj;
    }
    outputs.request_body = JSON.stringify(requestBody);
    outputs.calendar_id = inputs.calendarId.trim().toString() || "primary";
    outputs.event_id = inputs.eventId.trim();

})(inputs, outputs);

